INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 0, "春咲 ひより", 0, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 1, 0, 1001, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 0, "草野 優衣", 0, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", 2, 1, 0, 1002, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "少しは磨かれると思いますよ。", 1.4, 0, "士条 怜", 0, 0, 1, "フェンシングを始めてみては？", 2, 1, 0, 1003, "キミに必要な集中力と感性が");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 0, "穂高 みそぎ", 0, 0, 1, "ねぇ、にいちゃん！", 2, 1, 0, 1004, "今日はなにして遊ぶ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "私といっしょに…\nいかない？", 1.4, 0, "風宮 あかり", 0, 0, 1, "風宮あかりです", 2, 1, 0, 1006, "ねぇ…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "食べ物の恨みは怖いのー", 1.5, 0, "出雲 宮子", 0, 0, 1, "出雲宮子なのー", 2, 1, 0, 1007, "プリンたべたいのー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "いいよ。\n見られることは運命さ…", 1.4, 0, "虹村 雪", 0, 0, 1, "ボクは虹村雪。", 2, 1, 0, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "人呼んで「疾風の冥姫」!!", 1.4, 0, "柊杏奈", 0, 0, 1, "フッ…聞いて後悔するがいい！", 2, 1, 0, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ほんまおおきにやわ～♪", 1.5, 0, "姫宮 真歩", 0, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 2, 1, 0, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ここで会ったが\n100年目～！", 1.4, 0, "衣之咲 璃乃", 0, 0, 1, "衣之咲璃乃です！", 2, 1, 0, 1011, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 0, "柏崎 初音", 0, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 1, 0, 1012, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 0, "美波 鈴奈", 0, 0, 1, "ちょす！\n美波鈴奈だよ～♪", 2, 1, 0, 1016, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "でも、沖縄もとってもいいとこさー", 1.4, 0, "喜屋武 香織", 0, 0, 1, "はいたーい。\n喜屋武香織さー。", 2, 1, 0, 1017, "東京は遊園地みたいなところさー");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "イオちゃんって呼んでね。", 1.4, 0, "支倉 伊緒", 0, 0, 1, "支倉伊緒です。", 2, 1, 0, 1018, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ミミをおいてかないでぇ～", 1.5, 0, "茜 ミミ", 0, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 1, 0, 1020, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ふぇぇぇぇぇん……", 1.5, 0, "栗林 くるみ", 0, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 1, 0, 1021, "あの……\nふぇ……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "なんてありがとうございます！", 1.4, 0, "風宮 より", 0, 0, 1, "風宮よりです。\nあああああ！", 2, 1, 0, 1022, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "私こっち行きたいー\nね、早く早くー", 1.5, 0, "北条 綾音", 0, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 1, 0, 1023, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "これて何か違う…\nあああすみません！", 1.4, 0, "天野 すずめ", 0, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", 2, 1, 0, 1025, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "離しませんわ………\n絶対に…!!", 1.4, 0, "倉石 恵理子", 0, 0, 1, "……クスクス…私は\n…倉石恵理子……", 2, 1, 0, 1027, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "…そうでしょ？？", 1.4, 0, "佐々木 咲恋", 0, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 1, 0, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "あはは、\n私もまだまだだなぁ～", 1.4, 0, "桜井 望", 0, 0, 1, "桜井望だよ！\nよろしくねっ", 2, 1, 0, 1029, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 0, "ニノン・ジュベール", 0, 0, 1, "デケデケデンっ！", 2, 1, 0, 1030, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "おかしいですね……", 1.4, 0, "上喜 しのぶ", 0, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", 2, 1, 0, 1031, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そう、\nオラのボケに突っ込める相方が…！", 1.5, 0, "野戸まひる", 0, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 2, 1, 0, 1033, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ちょ\nちょっと一杯飲んできます…！", 1.4, 0, "綾瀬 ゆかり", 0, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 1, 0, 1034, "ちょっと緊張しちゃって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "これ以上お話しすることは…\nないです！", 1.5, 0, "氷川 鏡華", 0, 0, 1, "氷川鏡華…です", 2, 1, 0, 1036, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4, 0, "柏崎 栞", 0, 0, 1, "柏崎…栞です。", 2, 1, 0, 1038, "……あ、アラーム。");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "野に咲く花が、\n唯一の話相手です。", 1.4, 0, "双葉 碧", 0, 0, 1, "ふ、双葉碧です。", 2, 1, 0, 1040, "私、一人も友達がいなくて……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そう思っています。", 1.4, 0, "三角 千歌", 0, 0, 1, "三角千歌です。", 2, 1, 0, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "う、疑ってすまなかったな…", 1.4, 0, "安芸 真琴", 0, 0, 1, "安芸真琴だ。", 2, 1, 0, 1043, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4, 0, "イリヤ・オーンスタイン", 0, 0, 1, "わらわこそは夜を総べる者！", 2, 1, 0, 1044, "生けとし生ける全ての者よ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "ｌク、クウカに何かご用ですか!?", 1.4, 0, "遠見 空花", 0, 0, 1, "そこで騎士は妖精を乱暴に……", 2, 1, 0, 1045, "ぐふふふふ……はっ！");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1.4, 0, "宮坂たまき", 0, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 1, 0, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4, 0, "大神 美冬", 0, 0, 1, "大神美冬よ！", 2, 1, 0, 1048, "それでは早速クエストに…");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4, 0, "星野静流", 0, 0, 1, "星野静流だよ！", 2, 1, 0, 1049, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5, 0, "玉泉美咲", 0, 0, 1, "アタシは玉泉美咲。", 2, 1, 0, 1050, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "？？？？", 1.4, 0, "リマ", 0, 0, 1, "？？？", 2, 1, 0, 1052, "？？？？");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "モニカ・ヴァイスヴィント", 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1, 0, 1053, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "ペコリーヌ", 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1, 0, 1058, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "コッコロ", 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1, 0, 1059, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 0, "そ、そこまでいうなら\nもらってやる", 1.5, 0, "キャル", 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1, 0, 1060, "菓子でつろうなどと\n稚拙な策を……");
